          description: "All SavedQueries belong to the Dataset will be returned in\
            \ List/Get Dataset response. The annotation_specs field will not be populated\
            \ except for UI cases which will only use annotation_spec_count. In CreateDataset\
            \ request, a SavedQuery is created together if this field is set, up to\
            \ one SavedQuery can be set in CreateDatasetRequest. The SavedQuery should\
