          description: "Applicable only to custom training with Datasets that have\
            \ DataItems and Annotations. Cloud Storage URI that points to a YAML file\
            \ describing the annotation schema. The schema is defined as an OpenAPI\
            \ 3.0.2 [Schema Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.0.2.md#schemaObject).\
