            \ Dataset specified by dataset_id. Only Annotations that both match this\
            \ schema and belong to DataItems not ignored by the split method are used\
            \ in respectively training, validation or test role, depending on the\
            \ role of the DataItem they are on. When used in conjunction with annotations_filter,\
            \ the Annotations used for training are filtered by both annotations_filter\
            \ and annotation_schema_uri."
          type: string
        persistMlUseAssignment:
          description: Whether to persist the ML use assignment to data item system
            labels.
          type: boolean
