          - Default value of the enum.
          - Datapoints are eligible iff their value is < the query's.
          - Datapoints are eligible iff their value is <= the query's.
          - Datapoints are eligible iff their value is == the query's.
          - Datapoints are eligible iff their value is >= the query's.
          - Datapoints are eligible iff their value is > the query's.
          - Datapoints are eligible iff their value is != the query's.
