            \ will be trained from scratch. The `base` model must be in the same Project\
            \ and Location as the new Model to train, and have the same modelType."
          type: string
        multiLabel:
          description: "If false, a single-label (multi-class) Model will be trained\
            \ (i.e. assuming that for each image just up to one annotation may be\
            \ applicable). If true, a multi-label Model will be trained (i.e. assuming\
            \ that for each image multiple annotations may be applicable)."
          type: boolean
        budgetMilliNodeHours:
          description: "The training budget of creating this model, expressed in milli\
            \ node hours i.e. 1,000 value in this field means 1 node hour. The actual\
            \ metadata.costMilliNodeHours will be equal or less than this value. If\
            \ further model training ceases to provide any improvements, it will stop\
            \ without using the full budget and the metadata.successfulStopReason\
            \ will be `model-converged`. Note, node_hour = actual_hour * number_of_nodes_involved.\
            \ For modelType `cloud`(default), the budget must be between 8,000 and\
            \ 800,000 milli node hours, inclusive. The default value is 192,000 which\
            \ represents one day in wall time, considering 8 nodes are used. For model\
            \ types `mobile-tf-low-latency-1`, `mobile-tf-versatile-1`, `mobile-tf-high-accuracy-1`,\
            \ the training budget must be between 1,000 and 100,000 milli node hours,\
            \ inclusive. The default value is 24,000 which represents one day in wall\
            \ time on a single node that is used."
          format: int64
          type: string
        modelType:
          enum:
          - MODEL_TYPE_UNSPECIFIED
          - CLOUD
          - CLOUD_1
          - MOBILE_TF_LOW_LATENCY_1
          - MOBILE_TF_VERSATILE_1
          - MOBILE_TF_HIGH_ACCURACY_1
          - EFFICIENTNET
          - MAXVIT
          - VIT
          - COCA
          type: string
          enumDescriptions:
          - Should not be set.
          - "A Model best tailored to be used within Google Cloud, and which cannot\
            \ be exported. Default."
          - "A model type best tailored to be used within Google Cloud, which cannot\
            \ be exported externally. Compared to the CLOUD model above, it is expected\
            \ to have higher prediction accuracy."
          - "A model that, in addition to being available within Google Cloud, can\
            \ also be exported (see ModelService.ExportModel) as TensorFlow or Core\
            \ ML model and used on a mobile or edge device afterwards. Expected to\
            \ have low latency, but may have lower prediction quality than other mobile\
            \ models."
          - "A model that, in addition to being available within Google Cloud, can\
            \ also be exported (see ModelService.ExportModel) as TensorFlow or Core\
            \ ML model and used on a mobile or edge device with afterwards."
          - "A model that, in addition to being available within Google Cloud, can\
            \ also be exported (see ModelService.ExportModel) as TensorFlow or Core\
            \ ML model and used on a mobile or edge device afterwards. Expected to\
            \ have a higher latency, but should also have a higher prediction quality\
            \ than other mobile models."
          - "EfficientNet model for Model Garden training with customizable hyperparameters.\
            \ Best tailored to be used within Google Cloud, and cannot be exported\
            \ externally."
          - "MaxViT model for Model Garden training with customizable hyperparameters.\
            \ Best tailored to be used within Google Cloud, and cannot be exported\
            \ externally."
          - "ViT model for Model Garden training with customizable hyperparameters.\
            \ Best tailored to be used within Google Cloud, and cannot be exported\
            \ externally."
          - "CoCa model for Model Garden training with customizable hyperparameters.\
            \ Best tailored to be used within Google Cloud, and cannot be exported\
            \ externally."
        uptrainBaseModelId:
          description: "The ID of `base` model for upTraining. If it is specified,\
            \ the new model will be upTrained based on the `base` model for upTraining.\
            \ Otherwise, the new model will be trained from scratch. The `base` model\
            \ for upTraining must be in the same Project and Location as the new Model\
            \ to train, and have the same modelType."
          type: string
        disableEarlyStopping:
          description: "Use the entire training budget. This disables the early stopping\
            \ feature. When false the early stopping feature is enabled, which means\
            \ that AutoML Image Classification might stop training before the entire\
            \ training budget has been used."
