      description: Explanation of a prediction (provided in PredictResponse.predictions)
        produced by the Model on a given instance.
      example:
        neighbors:
        - neighborId: neighborId
          neighborDistance: 5.962133916683182
        - neighborId: neighborId
          neighborDistance: 5.962133916683182
        attributions:
        - outputDisplayName: outputDisplayName
          outputIndex:
          - 1
          - 1
          featureAttributions: ""
          outputName: outputName
          instanceOutputValue: 0.8008281904610115
          approximationError: 6.027456183070403
          baselineOutputValue: 5.962133916683182
        - outputDisplayName: outputDisplayName
          outputIndex:
          - 1
          - 1
          featureAttributions: ""
          outputName: outputName
          instanceOutputValue: 0.8008281904610115
          approximationError: 6.027456183070403
          baselineOutputValue: 5.962133916683182
      properties:
        neighbors:
          description: "Output only. List of the nearest neighbors for example-based\
            \ explanations. For models deployed with the examples explanations feature\
            \ enabled, the attributions field is empty and instead the neighbors field\
            \ is populated."
          items:
            $ref: '#/components/schemas/GoogleCloudAiplatformV1Neighbor'
          type: array
        attributions:
          description: "Output only. Feature attributions grouped by predicted outputs.\
            \ For Models that predict only one output, such as regression Models that\
            \ predict only one score, there is only one attibution that explains the\
            \ predicted output. For Models that predict multiple outputs, such as\
            \ multiclass Models that predict multiple classes, each element explains\
            \ one specific item. Attribution.output_index can be used to identify\
            \ which output this attribution is explaining. By default, we provide\
            \ Shapley values for the predicted class. However, you can configure the\
            \ explanation request to generate Shapley values for any other classes\
            \ too. For example, if a model predicts a probability of `0.4` for approving\
            \ a loan application, the model's decision is to reject the application\
            \ since `p(reject) = 0.6 > p(approve) = 0.4`, and the default Shapley\
            \ values would be computed for rejection decision and not approval, even\
            \ though the latter might be the positive class. If users set ExplanationParameters.top_k,\
            \ the attributions are sorted by instance_output_value in descending order.\
            \ If ExplanationParameters.output_indices is specified, the attributions\
            \ are stored by Attribution.output_index in the same order as they appear\
            \ in the output_indices."
          items:
            $ref: '#/components/schemas/GoogleCloudAiplatformV1Attribution'
          type: array
      id: GoogleCloudAiplatformV1Explanation
