        createTime:
          description: Output only. Timestamp when this Schedule was created.
          format: google-datetime
          readOnly: true
          type: string
        startedRunCount:
          description: Output only. The number of runs started by this schedule.
          format: int64
          readOnly: true
          type: string
        lastResumeTime:
          description: Output only. Timestamp when this Schedule was last resumed.
            Unset if never resumed from pause.
          format: google-datetime
          readOnly: true
          type: string
        cron:
          description: "Cron schedule (https://en.wikipedia.org/wiki/Cron) to launch\
            \ scheduled runs. To explicitly set a timezone to the cron tab, apply\
            \ a prefix in the cron tab: \"CRON_TZ=${IANA_TIME_ZONE}\" or \"TZ=${IANA_TIME_ZONE}\"\
            . The ${IANA_TIME_ZONE} may only be a valid string from IANA time zone\
            \ database. For example, \"CRON_TZ=America/New_York 1 * * * *\", or \"\
            TZ=America/New_York 1 * * * *\"."
          type: string
        endTime:
          description: "Optional. Timestamp after which no new runs can be scheduled.\
            \ If specified, The schedule will be completed when either end_time is\
            \ reached or when scheduled_run_count >= max_run_count. If not specified,\
            \ new runs will keep getting scheduled until this Schedule is paused or\
            \ deleted. Already scheduled runs will be allowed to complete. Unset if\
            \ not specified."
          format: google-datetime
          type: string
        createNotebookExecutionJobRequest:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1CreateNotebookExecutionJobRequest'
        catchUp:
          description: "Output only. Whether to backfill missed runs when the schedule\
            \ is resumed from PAUSED state. If set to true, all missed runs will be\
            \ scheduled. New runs will be scheduled after the backfill is complete.\
            \ Default to false."
          readOnly: true
          type: boolean
        maxConcurrentRunCount:
          description: Required. Maximum number of runs that can be started concurrently
            for this Schedule. This is the limit for starting the scheduled requests
            and not the execution of the operations/jobs created by the requests (if
            applicable).
          format: int64
          type: string
        state:
          description: Output only. The state of this Schedule.
          enum:
          - STATE_UNSPECIFIED
          - ACTIVE
          - PAUSED
          - COMPLETED
          readOnly: true
          type: string
          enumDescriptions:
          - Unspecified.
          - The Schedule is active. Runs are being scheduled on the user-specified
            timespec.
          - The schedule is paused. No new runs will be created until the schedule
            is resumed. Already started runs will be allowed to complete.
          - The Schedule is completed. No new runs will be scheduled. Already started
            runs will be allowed to complete. Schedules in completed state cannot
            be paused or resumed.
        maxRunCount:
          description: "Optional. Maximum run count of the schedule. If specified,\
            \ The schedule will be completed when either started_run_count >= max_run_count\
            \ or when end_time is reached. If not specified, new runs will keep getting\
            \ scheduled until this Schedule is paused or deleted. Already scheduled\
            \ runs will be allowed to complete. Unset if not specified."
          format: int64
          type: string
        startTime:
          description: Optional. Timestamp after which the first run can be scheduled.
            Default to Schedule create time if not specified.
          format: google-datetime
          type: string
        name:
          description: Immutable. The resource name of the Schedule.
          type: string
        createPipelineJobRequest:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1CreatePipelineJobRequest'
        updateTime:
          description: Output only. Timestamp when this Schedule was updated.
          format: google-datetime
          readOnly: true
          type: string
      id: GoogleCloudAiplatformV1Schedule
