    GoogleCloudAiplatformV1ExplanationMetadataInputMetadataVisualization:
      description: Visualization configurations for image explanation.
      example:
        clipPercentLowerbound: 5.637377
        clipPercentUpperbound: 2.302136
        overlayType: OVERLAY_TYPE_UNSPECIFIED
        type: TYPE_UNSPECIFIED
        colorMap: COLOR_MAP_UNSPECIFIED
        polarity: POLARITY_UNSPECIFIED
      properties:
        clipPercentLowerbound:
          description: "Excludes attributions below the specified percentile, from\
            \ the highlighted areas. Defaults to 62."
          format: float
          type: number
        overlayType:
          description: How the original image is displayed in the visualization. Adjusting
            the overlay can help increase visual clarity if the original image makes
            it difficult to view the visualization. Defaults to NONE.
          enum:
          - OVERLAY_TYPE_UNSPECIFIED
          - NONE
          - ORIGINAL
          - GRAYSCALE
          - MASK_BLACK
          type: string
          enumDescriptions:
          - Default value. This is the same as NONE.
          - No overlay.
          - The attributions are shown on top of the original image.
          - The attributions are shown on top of grayscaled version of the original
            image.
          - The attributions are used as a mask to reveal predictive parts of the
            image and hide the un-predictive parts.
        polarity:
          description: "Whether to only highlight pixels with positive contributions,\
            \ negative or both. Defaults to POSITIVE."
          enum:
          - POLARITY_UNSPECIFIED
          - POSITIVE
          - NEGATIVE
          - BOTH
          type: string
          enumDescriptions:
          - Default value. This is the same as POSITIVE.
          - Highlights the pixels/outlines that were most influential to the model's
            prediction.
          - Setting polarity to negative highlights areas that does not lead to the
            models's current prediction.
          - Shows both positive and negative attributions.
        clipPercentUpperbound:
          description: Excludes attributions above the specified percentile from the
            highlighted areas. Using the clip_percent_upperbound and clip_percent_lowerbound
            together can be useful for filtering out noise and making it easier to
            see areas of strong attribution. Defaults to 99.9.
          format: float
          type: number
        type:
          description: "Type of the image visualization. Only applicable to Integrated\
            \ Gradients attribution. OUTLINES shows regions of attribution, while\
            \ PIXELS shows per-pixel attribution. Defaults to OUTLINES."
          enum:
          - TYPE_UNSPECIFIED
          - PIXELS
          - OUTLINES
          type: string
          enumDescriptions:
          - Should not be used.
          - Shows which pixel contributed to the image prediction.
          - Shows which region contributed to the image prediction by outlining the
            region.
        colorMap:
          description: "The color scheme used for the highlighted areas. Defaults\
            \ to PINK_GREEN for Integrated Gradients attribution, which shows positive\
            \ attributions in green and negative in pink. Defaults to VIRIDIS for\
            \ XRAI attribution, which highlights the most influential regions in yellow\
            \ and the least influential in blue."
          enum:
          - COLOR_MAP_UNSPECIFIED
          - PINK_GREEN
          - VIRIDIS
          - RED
          - GREEN
          - RED_GREEN
          - PINK_WHITE_GREEN
          type: string
          enumDescriptions:
          - Should not be used.
          - "Positive: green. Negative: pink."
          - "Viridis color map: A perceptually uniform color mapping which is easier\
            \ to see by those with colorblindness and progresses from yellow to green\
            \ to blue. Positive: yellow. Negative: blue."
          - "Positive: red. Negative: red."
          - "Positive: green. Negative: green."
          - "Positive: green. Negative: red."
          - PiYG palette.
      id: GoogleCloudAiplatformV1ExplanationMetadataInputMetadataVisualization
    GoogleCloudAiplatformV1PairwiseQuestionAnsweringQualityResult:
