    GoogleCloudAiplatformV1StratifiedSplit:
      description: "Assigns input data to the training, validation, and test sets\
        \ so that the distribution of values found in the categorical column (as specified\
        \ by the `key` field) is mirrored within each split. The fraction values determine\
        \ the relative sizes of the splits. For example, if the specified column has\
        \ three values, with 50% of the rows having value \"A\", 25% value \"B\",\
        \ and 25% value \"C\", and the split fractions are specified as 80/10/10,\
        \ then the training set will constitute 80% of the training data, with about\
        \ 50% of the training set rows having the value \"A\" for the specified column,\
        \ about 25% having the value \"B\", and about 25% having the value \"C\".\
        \ Only the top 500 occurring values are used; any values not in the top 500\
        \ values are randomly assigned to a split. If less than three rows contain\
        \ a specific value, those rows are randomly assigned. Supported only for tabular\
        \ Datasets."
      example:
        validationFraction: 6.027456183070403
        testFraction: 0.8008281904610115
        trainingFraction: 1.4658129805029452
        key: key
      properties:
        testFraction:
          description: The fraction of the input data that is to be used to evaluate
            the Model.
          format: double
          type: number
        key:
          description: Required. The key is a name of one of the Dataset's data columns.
            The key provided must be for a categorical column.
          type: string
        validationFraction:
          description: The fraction of the input data that is to be used to validate
            the Model.
          format: double
          type: number
        trainingFraction:
          description: The fraction of the input data that is to be used to train
            the Model.
          format: double
          type: number
      id: GoogleCloudAiplatformV1StratifiedSplit
