    GoogleCloudAiplatformV1ModelContainerSpec:
      description: "Specification of a container for serving predictions. Some fields\
        \ in this message correspond to fields in the [Kubernetes Container v1 core\
        \ specification](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core)."
      example:
        args:
        - args
        - args
        imageUri: imageUri
        healthProbe:
          timeoutSeconds: 9
          periodSeconds: 3
          exec:
            command:
            - command
            - command
        deploymentTimeout: deploymentTimeout
        predictRoute: predictRoute
        sharedMemorySizeMb: sharedMemorySizeMb
        grpcPorts:
        - containerPort: 7
        - containerPort: 7
        startupProbe:
          timeoutSeconds: 9
          periodSeconds: 3
          exec:
            command:
            - command
            - command
        healthRoute: healthRoute
        env:
        - name: name
          value: value
        - name: name
          value: value
        ports:
        - containerPort: 7
        - containerPort: 7
        command:
        - command
        - command
      properties:
        imageUri:
          description: "Required. Immutable. URI of the Docker image to be used as\
            \ the custom container for serving predictions. This URI must identify\
            \ an image in Artifact Registry or Container Registry. Learn more about\
            \ the [container publishing requirements](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#publishing),\
            \ including permissions requirements for the Vertex AI Service Agent.\
            \ The container image is ingested upon ModelService.UploadModel, stored\
            \ internally, and this original path is afterwards not used. To learn\
            \ about the requirements for the Docker image itself, see [Custom container\
            \ requirements](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#).\
            \ You can use the URI to one of Vertex AI's [pre-built container images\
            \ for prediction](https://cloud.google.com/vertex-ai/docs/predictions/pre-built-containers)\
            \ in this field."
          type: string
        healthRoute:
          description: "Immutable. HTTP path on the container to send health checks\
            \ to. Vertex AI intermittently sends GET requests to this path on the\
            \ container's IP address and port to check that the container is healthy.\
            \ Read more about [health checks](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#health).\
            \ For example, if you set this field to `/bar`, then Vertex AI intermittently\
            \ sends a GET request to the `/bar` path on the port of your container\
            \ specified by the first value of this `ModelContainerSpec`'s ports field.\
            \ If you don't specify this field, it defaults to the following value\
            \ when you deploy this Model to an Endpoint: /v1/endpoints/ENDPOINT/deployedModels/\
            \ DEPLOYED_MODEL:predict The placeholders in this value are replaced as\
            \ follows: * ENDPOINT: The last segment (following `endpoints/`)of the\
            \ Endpoint.name][] field of the Endpoint where this Model has been deployed.\
            \ (Vertex AI makes this value available to your container code as the\
            \ [`AIP_ENDPOINT_ID` environment variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)\
            \ * DEPLOYED_MODEL: DeployedModel.id of the `DeployedModel`. (Vertex AI\
            \ makes this value available to your container code as the [`AIP_DEPLOYED_MODEL_ID`\
            \ environment variable](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#aip-variables).)"
          type: string
        env:
          description: "Immutable. List of environment variables to set in the container.\
            \ After the container starts running, code running in the container can\
            \ read these environment variables. Additionally, the command and args\
            \ fields can reference these variables. Later entries in this list can\
            \ also reference earlier entries. For example, the following example sets\
            \ the variable `VAR_2` to have the value `foo bar`: ```json [ { \"name\"\
            : \"VAR_1\", \"value\": \"foo\" }, { \"name\": \"VAR_2\", \"value\": \"\
            $(VAR_1) bar\" } ] ``` If you switch the order of the variables in the\
            \ example, then the expansion does not occur. This field corresponds to\
            \ the `env` field of the Kubernetes Containers [v1 core API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core)."
          items:
            $ref: '#/components/schemas/GoogleCloudAiplatformV1EnvVar'
          type: array
        ports:
          description: "Immutable. List of ports to expose from the container. Vertex\
            \ AI sends any prediction requests that it receives to the first port\
            \ on this list. Vertex AI also sends [liveness and health checks](https://cloud.google.com/vertex-ai/docs/predictions/custom-container-requirements#liveness)\
            \ to this port. If you do not specify this field, it defaults to following\
            \ value: ```json [ { \"containerPort\": 8080 } ] ``` Vertex AI does not\
            \ use ports other than the first one listed. This field corresponds to\
            \ the `ports` field of the Kubernetes Containers [v1 core API](https://kubernetes.io/docs/reference/generated/kubernetes-api/v1.23/#container-v1-core)."
          items:
            $ref: '#/components/schemas/GoogleCloudAiplatformV1Port'
          type: array
        args:
          description: "Immutable. Specifies arguments for the command that runs when\
            \ the container starts. This overrides the container's [`CMD`](https://docs.docker.com/engine/reference/builder/#cmd).\
            \ Specify this field as an array of executable and arguments, similar\
            \ to a Docker `CMD`'s \"default parameters\" form. If you don't specify\
            \ this field but do specify the command field, then the command from the\
            \ `command` field runs without any additional arguments. See the [Kubernetes\
            \ documentation about how the `command` and `args` fields interact with\
            \ a container's `ENTRYPOINT` and `CMD`](https://kubernetes.io/docs/tasks/inject-data-application/define-command-argument-container/#notes).\
            \ If you don't specify this field and don't specify the `command` field,\
