            \ to a Docker `ENTRYPOINT`'s \"exec\" form, not its \"shell\" form. If\
            \ you do not specify this field, then the container's `ENTRYPOINT` runs,\
            \ in conjunction with the args field or the container's [`CMD`](https://docs.docker.com/engine/reference/builder/#cmd),\
            \ if either exists. If this field is not specified and the container does\
            \ not have an `ENTRYPOINT`, then refer to the Docker documentation about\
            \ [how `CMD` and `ENTRYPOINT` interact](https://docs.docker.com/engine/reference/builder/#understand-how-cmd-and-entrypoint-interact).\
            \ If you specify this field, then you can also specify the `args` field\
            \ to provide additional arguments for this command. However, if you specify\
            \ this field, then the container's `CMD` is ignored. See the [Kubernetes\
            \ documentation about how the `command` and `args` fields interact with\
            \ a container's `ENTRYPOINT` and `CMD`](https://kubernetes.io/docs/tasks/inject-data-application/define-command-argument-container/#notes).\
