          description: "Immutable. List of ports to expose from the container. Vertex\
            \ AI sends gRPC prediction requests that it receives to the first port\
            \ on this list. Vertex AI also sends liveness and health checks to this\
            \ port. If you do not specify this field, gRPC requests to the container\
            \ will be disabled. Vertex AI does not use ports other than the first\
            \ one listed. This field corresponds to the `ports` field of the Kubernetes\
            \ Containers v1 core API."
