    GoogleCloudAiplatformV1FeatureViewIndexConfig:
      description: Configuration for vector indexing.
      example:
        bruteForceConfig: "{}"
        embeddingColumn: embeddingColumn
        crowdingColumn: crowdingColumn
        embeddingDimension: 0
        filterColumns:
        - filterColumns
        - filterColumns
        distanceMeasureType: DISTANCE_MEASURE_TYPE_UNSPECIFIED
        treeAhConfig:
          leafNodeEmbeddingCount: leafNodeEmbeddingCount
      properties:
        treeAhConfig:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1FeatureViewIndexConfigTreeAHConfig'
        crowdingColumn:
          description: "Optional. Column of crowding. This column contains crowding\
            \ attribute which is a constraint on a neighbor list produced by FeatureOnlineStoreService.SearchNearestEntities\
            \ to diversify search results. If NearestNeighborQuery.per_crowding_attribute_neighbor_count\
            \ is set to K in SearchNearestEntitiesRequest, it's guaranteed that no\
            \ more than K entities of the same crowding attribute are returned in\
            \ the response."
          type: string
        bruteForceConfig:
          description: Configuration options for using brute force search.
          properties: {}
          type: object
          id: GoogleCloudAiplatformV1FeatureViewIndexConfigBruteForceConfig
        distanceMeasureType:
          description: Optional. The distance measure used in nearest neighbor search.
          enum:
          - DISTANCE_MEASURE_TYPE_UNSPECIFIED
          - SQUARED_L2_DISTANCE
          - COSINE_DISTANCE
          - DOT_PRODUCT_DISTANCE
          type: string
          enumDescriptions:
          - Should not be set.
          - Euclidean (L_2) Distance.
          - "Cosine Distance. Defined as 1 - cosine similarity. We strongly suggest\
            \ using DOT_PRODUCT_DISTANCE + UNIT_L2_NORM instead of COSINE distance.\
            \ Our algorithms have been more optimized for DOT_PRODUCT distance which,\
            \ when combined with UNIT_L2_NORM, is mathematically equivalent to COSINE\
            \ distance and results in the same ranking."
          - Dot Product Distance. Defined as a negative of the dot product.
        embeddingDimension:
          description: Optional. The number of dimensions of the input embedding.
          format: int32
          type: integer
        embeddingColumn:
          description: Optional. Column of embedding. This column contains the source
            data to create index for vector search. embedding_column must be set when
            using vector search.
          type: string
        filterColumns:
          description: Optional. Columns of features that're used to filter vector
            search results.
          items:
            type: string
          type: array
      id: GoogleCloudAiplatformV1FeatureViewIndexConfig
