      description: "Config that contains the strategy used to generate sliding windows\
        \ in time series training. A window is a series of rows that comprise the\
        \ context up to the time of prediction, and the horizon following. The corresponding\
        \ row for each window marks the start of the forecast horizon. Each window\
        \ is used as an input example for training/evaluation."
