        maxCount:
          description: Maximum number of windows that should be generated across all
            time series.
          format: int64
          type: string
        strideLength:
          description: "Stride length used to generate input examples. Within one\
            \ time series, every {$STRIDE_LENGTH} rows will be used to generate a\
            \ sliding window."
          format: int64
          type: string
        column:
          description: "Name of the column that should be used to generate sliding\
            \ windows. The column should contain either booleans or string booleans;\
            \ if the value of the row is True, generate a sliding window with the\
            \ horizon starting at that row. The column will not be used as a feature\
            \ in training."
          type: string
      id: GoogleCloudAiplatformV1SchemaTrainingjobDefinitionWindowConfig
