    GoogleCloudAiplatformV1SafetySetting:
      description: Safety settings.
      example:
        method: HARM_BLOCK_METHOD_UNSPECIFIED
        threshold: HARM_BLOCK_THRESHOLD_UNSPECIFIED
        category: HARM_CATEGORY_UNSPECIFIED
      properties:
        category:
          description: Required. Harm category.
          enum:
          - HARM_CATEGORY_UNSPECIFIED
          - HARM_CATEGORY_HATE_SPEECH
          - HARM_CATEGORY_DANGEROUS_CONTENT
          - HARM_CATEGORY_HARASSMENT
          - HARM_CATEGORY_SEXUALLY_EXPLICIT
          - HARM_CATEGORY_CIVIC_INTEGRITY
          type: string
          enumDescriptions:
          - The harm category is unspecified.
          - The harm category is hate speech.
          - The harm category is dangerous content.
          - The harm category is harassment.
          - The harm category is sexually explicit content.
          - The harm category is civic integrity.
        threshold:
          description: Required. The harm block threshold.
          enum:
          - HARM_BLOCK_THRESHOLD_UNSPECIFIED
          - BLOCK_LOW_AND_ABOVE
          - BLOCK_MEDIUM_AND_ABOVE
          - BLOCK_ONLY_HIGH
          - BLOCK_NONE
          - "OFF"
          type: string
          enumDescriptions:
          - Unspecified harm block threshold.
          - Block low threshold and above (i.e. block more).
          - Block medium threshold and above.
          - Block only high threshold (i.e. block less).
          - Block none.
          - Turn off the safety filter.
        method:
          description: "Optional. Specify if the threshold is used for probability\
            \ or severity score. If not specified, the threshold is used for probability\
            \ score."
          enum:
          - HARM_BLOCK_METHOD_UNSPECIFIED
          - SEVERITY
          - PROBABILITY
          type: string
          enumDescriptions:
          - The harm block method is unspecified.
          - The harm block method uses both probability and severity scores.
          - The harm block method uses the probability score.
      id: GoogleCloudAiplatformV1SafetySetting
    GoogleCloudAiplatformV1SchemaTrainingjobDefinitionAutoMlImageObjectDetectionInputs:
      properties:
        uptrainBaseModelId:
          description: "The ID of `base` model for upTraining. If it is specified,\
            \ the new model will be upTrained based on the `base` model for upTraining.\
            \ Otherwise, the new model will be trained from scratch. The `base` model\
            \ for upTraining must be in the same Project and Location as the new Model\
            \ to train, and have the same modelType."
          type: string
        modelType:
          enum:
          - MODEL_TYPE_UNSPECIFIED
          - CLOUD_HIGH_ACCURACY_1
          - CLOUD_LOW_LATENCY_1
          - CLOUD_1
          - MOBILE_TF_LOW_LATENCY_1
          - MOBILE_TF_VERSATILE_1
          - MOBILE_TF_HIGH_ACCURACY_1
          - CLOUD_STREAMING_1
          - SPINENET
          - YOLO
          type: string
          enumDescriptions:
          - Should not be set.
          - "A model best tailored to be used within Google Cloud, and which cannot\
            \ be exported. Expected to have a higher latency, but should also have\
            \ a higher prediction quality than other cloud models."
          - "A model best tailored to be used within Google Cloud, and which cannot\
            \ be exported. Expected to have a low latency, but may have lower prediction\
            \ quality than other cloud models."
          - "A model best tailored to be used within Google Cloud, and which cannot\
            \ be exported. Compared to the CLOUD_HIGH_ACCURACY_1 and CLOUD_LOW_LATENCY_1\
            \ models above, it is expected to have higher prediction quality and lower\
            \ latency."
          - "A model that, in addition to being available within Google Cloud can\
            \ also be exported (see ModelService.ExportModel) and used on a mobile\
            \ or edge device with TensorFlow afterwards. Expected to have low latency,\
            \ but may have lower prediction quality than other mobile models."
          - "A model that, in addition to being available within Google Cloud can\
            \ also be exported (see ModelService.ExportModel) and used on a mobile\
            \ or edge device with TensorFlow afterwards."
          - "A model that, in addition to being available within Google Cloud, can\
            \ also be exported (see ModelService.ExportModel) and used on a mobile\
            \ or edge device with TensorFlow afterwards. Expected to have a higher\
            \ latency, but should also have a higher prediction quality than other\
            \ mobile models."
          - "A model best tailored to be used within Google Cloud, and which cannot\
            \ be exported. Expected to best support predictions in streaming with\
            \ lower latency and lower prediction quality than other cloud models."
          - "SpineNet for Model Garden training with customizable hyperparameters.\
            \ Best tailored to be used within Google Cloud, and cannot be exported\
            \ externally."
          - "YOLO for Model Garden training with customizable hyperparameters. Best\
            \ tailored to be used within Google Cloud, and cannot be exported externally."
        budgetMilliNodeHours:
          description: "The training budget of creating this model, expressed in milli\
            \ node hours i.e. 1,000 value in this field means 1 node hour. The actual\
            \ metadata.costMilliNodeHours will be equal or less than this value. If\
            \ further model training ceases to provide any improvements, it will stop\
            \ without using the full budget and the metadata.successfulStopReason\
            \ will be `model-converged`. Note, node_hour = actual_hour * number_of_nodes_involved.\
            \ For modelType `cloud`(default), the budget must be between 20,000 and\
            \ 900,000 milli node hours, inclusive. The default value is 216,000 which\
            \ represents one day in wall time, considering 9 nodes are used. For model\
            \ types `mobile-tf-low-latency-1`, `mobile-tf-versatile-1`, `mobile-tf-high-accuracy-1`\
            \ the training budget must be between 1,000 and 100,000 milli node hours,\
            \ inclusive. The default value is 24,000 which represents one day in wall\
            \ time on a single node that is used."
          format: int64
          type: string
        disableEarlyStopping:
          description: "Use the entire training budget. This disables the early stopping\
            \ feature. When false the early stopping feature is enabled, which means\
            \ that AutoML Image Object Detection might stop training before the entire\
            \ training budget has been used."
          type: boolean
        tunableParameter:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1SchemaTrainingjobDefinitionAutomlImageTrainingTunableParameter'
      id: GoogleCloudAiplatformV1SchemaTrainingjobDefinitionAutoMlImageObjectDetectionInputs
    GoogleCloudAiplatformV1Featurestore:
      description: "Vertex AI Feature Store provides a centralized repository for\
        \ organizing, storing, and serving ML features. The Featurestore is a top-level\
        \ container for your features and their values."
      example:
        createTime: createTime
        name: name
        updateTime: updateTime
        satisfiesPzs: true
        etag: etag
        onlineServingConfig:
          scaling:
            minNodeCount: 5
            maxNodeCount: 5
            cpuUtilizationTarget: 1
          fixedNodeCount: 6
        onlineStorageTtlDays: 0
        encryptionSpec:
          kmsKeyName: kmsKeyName
        state: STATE_UNSPECIFIED
        satisfiesPzi: true
        labels:
          key: labels
      properties:
        onlineStorageTtlDays:
          description: "Optional. TTL in days for feature values that will be stored\
            \ in online serving storage. The Feature Store online storage periodically\
            \ removes obsolete feature values older than `online_storage_ttl_days`\
            \ since the feature generation time. Note that `online_storage_ttl_days`\
            \ should be less than or equal to `offline_storage_ttl_days` for each\
            \ EntityType under a featurestore. If not set, default to 4000 days"
          format: int32
          type: integer
        updateTime:
          description: Output only. Timestamp when this Featurestore was last updated.
          format: google-datetime
          readOnly: true
          type: string
        satisfiesPzs:
          description: Output only. Reserved for future use.
          readOnly: true
          type: boolean
        labels:
          additionalProperties:
            type: string
          description: "Optional. The labels with user-defined metadata to organize\
            \ your Featurestore. Label keys and values can be no longer than 64 characters\
            \ (Unicode codepoints), can only contain lowercase letters, numeric characters,\
            \ underscores and dashes. International characters are allowed. See https://goo.gl/xmQnxf\
            \ for more information on and examples of labels. No more than 64 user\
            \ labels can be associated with one Featurestore(System labels are excluded).\"\
            \ System reserved label keys are prefixed with \"aiplatform.googleapis.com/\"\
            \ and are immutable."
        encryptionSpec:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1EncryptionSpec'
        etag:
          description: "Optional. Used to perform consistent read-modify-write updates.\
            \ If not set, a blind \"overwrite\" update happens."
          type: string
        satisfiesPzi:
          description: Output only. Reserved for future use.
          readOnly: true
          type: boolean
        state:
          description: Output only. State of the featurestore.
          enum:
          - STATE_UNSPECIFIED
          - STABLE
          - UPDATING
          readOnly: true
          type: string
          enumDescriptions:
          - Default value. This value is unused.
          - State when the featurestore configuration is not being updated and the
            fields reflect the current configuration of the featurestore. The featurestore
            is usable in this state.
          - "The state of the featurestore configuration when it is being updated.\
            \ During an update, the fields reflect either the original configuration\
            \ or the updated configuration of the featurestore. For example, `online_serving_config.fixed_node_count`\
            \ can take minutes to update. While the update is in progress, the featurestore\
            \ is in the UPDATING state, and the value of `fixed_node_count` can be\
            \ the original value or the updated value, depending on the progress of\
            \ the operation. Until the update completes, the actual number of nodes\
            \ can still be the original value of `fixed_node_count`. The featurestore\
            \ is still usable in this state."
        name:
          description: "Output only. Name of the Featurestore. Format: `projects/{project}/locations/{location}/featurestores/{featurestore}`"
          readOnly: true
          type: string
        onlineServingConfig:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1FeaturestoreOnlineServingConfig'
        createTime:
          description: Output only. Timestamp when this Featurestore was created.
          format: google-datetime
          readOnly: true
          type: string
      id: GoogleCloudAiplatformV1Featurestore
