        \ as per the given fractions. Any of `training_fraction`, `validation_fraction`\
        \ and `test_fraction` may optionally be provided, they must sum to up to 1.\
        \ If the provided ones sum to less than 1, the remainder is assigned to sets\
        \ as decided by Vertex AI. If none of the fractions are set, by default roughly\
        \ 80% of data is used for training, 10% for validation, and 10% for test."
      example:
        validationFraction: 5.637376656633329
        testFraction: 2.3021358869347655
        trainingFraction: 5.962133916683182
