          description: The fraction of the input data that is to be used to validate
            the Model.
          format: double
          type: number
        testFraction:
          description: The fraction of the input data that is to be used to evaluate
            the Model.
          format: double
          type: number
      id: GoogleCloudAiplatformV1FractionSplit
