          $ref: '#/components/schemas/GoogleCloudAiplatformV1ModelDataStats'
        description:
          description: The description of the Model.
          type: string
        versionAliases:
          description: "User provided version aliases so that a model version can\
            \ be referenced via alias (i.e. `projects/{project}/locations/{location}/models/{model_id}@{version_alias}`\
            \ instead of auto-generated version id (i.e. `projects/{project}/locations/{location}/models/{model_id}@{version_id})`.\
            \ The format is a-z{0,126}[a-z0-9] to distinguish from version_id. A default\
            \ version alias will be created for the first version of the model, and\
            \ there must be exactly one default version alias for a model."
          items:
            type: string
          type: array
        metadataSchemaUri:
          description: "Immutable. Points to a YAML file stored on Google Cloud Storage\
            \ describing additional information about the Model, that is specific\
            \ to it. Unset if the Model does not have any additional information.\
            \ The schema is defined as an OpenAPI 3.0.2 [Schema Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.0.2.md#schemaObject).\
            \ AutoML Models always have this field populated by Vertex AI, if no additional\
            \ metadata is needed, this field is set to an empty string. Note: The\
            \ URI given on output will be immutable and probably different, including\
            \ the URI scheme, than the one given on input. The output URI will point\
            \ to a location where the user only has a read access."
          type: string
        metadata:
          description: Immutable. An additional information about the Model; the schema
            of the metadata can be found in metadata_schema. Unset if the Model does
            not have any additional information.
          type: any
        supportedDeploymentResourcesTypes:
          description: "Output only. When this Model is deployed, its prediction resources\
            \ are described by the `prediction_resources` field of the Endpoint.deployed_models\
            \ object. Because not all Models support all resource configuration types,\
            \ the configuration types this Model supports are listed here. If no configuration\
            \ types are listed, the Model cannot be deployed to an Endpoint and does\
            \ not support online predictions (PredictionService.Predict or PredictionService.Explain).\
            \ Such a Model can serve predictions by using a BatchPredictionJob, if\
            \ it has at least one entry each in supported_input_storage_formats and\
            \ supported_output_storage_formats."
          items:
            enum:
            - DEPLOYMENT_RESOURCES_TYPE_UNSPECIFIED
            - DEDICATED_RESOURCES
            - AUTOMATIC_RESOURCES
            - SHARED_RESOURCES
            type: string
            enumDescriptions:
            - Should not be used.
            - "Resources that are dedicated to the DeployedModel, and that need a\
              \ higher degree of manual configuration."
            - "Resources that to large degree are decided by Vertex AI, and require\
              \ only a modest additional configuration."
            - Resources that can be shared by multiple DeployedModels. A pre-configured
              DeploymentResourcePool is required.
          type: array
        displayName:
          description: Required. The display name of the Model. The name can be up
            to 128 characters long and can consist of any UTF-8 characters.
          type: string
        versionCreateTime:
          description: Output only. Timestamp when this version was created.
          format: google-datetime
          readOnly: true
          type: string
        versionId:
          description: Output only. Immutable. The version ID of the model. A new
            version is committed when a new model version is uploaded or trained under
            an existing model id. It is an auto-incrementing decimal number in string
            representation.
          readOnly: true
          type: string
        supportedExportFormats:
          description: "Output only. The formats in which this Model may be exported.\
            \ If empty, this Model is not available for export."
          items:
            $ref: '#/components/schemas/GoogleCloudAiplatformV1ModelExportFormat'
          type: array
        updateTime:
          description: Output only. Timestamp when this Model was most recently updated.
          format: google-datetime
          readOnly: true
          type: string
        trainingPipeline:
          description: "Output only. The resource name of the TrainingPipeline that\
            \ uploaded this Model, if any."
          readOnly: true
          type: string
        modelSourceInfo:
          $ref: '#/components/schemas/GoogleCloudAiplatformV1ModelSourceInfo'
      id: GoogleCloudAiplatformV1Model
