    GoogleCloudAiplatformV1AutomaticResources:
      description: "A description of resources that to large degree are decided by\
        \ Vertex AI, and require only a modest additional configuration. Each Model\
        \ supporting these resources documents its specific guidelines."
      example:
        minReplicaCount: 0
        maxReplicaCount: 6
      properties:
        minReplicaCount:
          description: "Immutable. The minimum number of replicas this DeployedModel\
            \ will be always deployed on. If traffic against it increases, it may\
            \ dynamically be deployed onto more replicas up to max_replica_count,\
            \ and as traffic decreases, some of these extra replicas may be freed.\
            \ If the requested value is too large, the deployment will error."
          format: int32
          type: integer
        maxReplicaCount:
          description: "Immutable. The maximum number of replicas this DeployedModel\
            \ may be deployed on when the traffic against it increases. If the requested\
            \ value is too large, the deployment will error, but if deployment succeeds\
            \ then the ability to scale the model to that many replicas is guaranteed\
            \ (barring service outages). If traffic against the DeployedModel increases\
            \ beyond what its replicas at maximum may handle, a portion of the traffic\
            \ will be dropped. If this value is not provided, a no upper bound for\
            \ scaling under heavy traffic will be assume, though Vertex AI may be\
            \ unable to scale beyond certain replica number."
          format: int32
          type: integer
      id: GoogleCloudAiplatformV1AutomaticResources
    GoogleCloudAiplatformV1SchemaTrainingjobDefinitionSeq2SeqPlusForecastingInputsTransformationTimestampTransformation:
      description: "Training pipeline will perform following transformation functions.\
        \ * Apply the transformation functions for Numerical columns. * Determine\
        \ the year, month, day,and weekday. Treat each value from the timestamp as\
        \ a Categorical column. * Invalid numerical values (for example, values that\
        \ fall outside of a typical timestamp range, or are extreme values) receive\
        \ no special treatment and are not removed."
      properties:
        columnName:
          type: string
        timeFormat:
          description: "The format in which that time field is expressed. The time_format\
            \ must either be one of: * `unix-seconds` * `unix-milliseconds` * `unix-microseconds`\
            \ * `unix-nanoseconds` (for respectively number of seconds, milliseconds,\
            \ microseconds and nanoseconds since start of the Unix epoch); or be written\
            \ in `strftime` syntax. If time_format is not set, then the default format\
            \ is RFC 3339 `date-time` format, where `time-offset` = `\"Z\"` (e.g.\
            \ 1985-04-12T23:20:50.52Z)"
          type: string
      id: GoogleCloudAiplatformV1SchemaTrainingjobDefinitionSeq2SeqPlusForecastingInputsTransformationTimestampTransformation
