    GoogleCloudAiplatformV1SchemaTrainingjobDefinitionAutoMlForecastingInputsTransformationCategoricalTransformation:
      description: "Training pipeline will perform following transformation functions.\
        \ * The categorical string as is--no change to case, punctuation, spelling,\
        \ tense, and so on. * Convert the category name to a dictionary lookup index\
        \ and generate an embedding for each index. * Categories that appear less\
        \ than 5 times in the training dataset are treated as the \"unknown\" category.\
        \ The \"unknown\" category gets its own special lookup index and resulting\
        \ embedding."
      properties:
        columnName:
          type: string
      id: GoogleCloudAiplatformV1SchemaTrainingjobDefinitionAutoMlForecastingInputsTransformationCategoricalTransformation
    GoogleCloudAiplatformV1SchemaPredictPredictionImageSegmentationPredictionResult:
      description: Prediction output format for Image Segmentation.
      properties:
        categoryMask:
          description: "A PNG image where each pixel in the mask represents the category\
            \ in which the pixel in the original image was predicted to belong to.\
            \ The size of this image will be the same as the original image. The mapping\
            \ between the AnntoationSpec and the color can be found in model's metadata.\
            \ The model will choose the most likely category and if none of the categories\
            \ reach the confidence threshold, the pixel will be marked as background."
          type: string
        confidenceMask:
          description: "A one channel image which is encoded as an 8bit lossless PNG.\
            \ The size of the image will be the same as the original image. For a\
            \ specific pixel, darker color means less confidence in correctness of\
            \ the cateogry in the categoryMask for the corresponding pixel. Black\
            \ means no confidence and white means complete confidence."
          type: string
      id: GoogleCloudAiplatformV1SchemaPredictPredictionImageSegmentationPredictionResult
